import React from "react";
import Title from "./Title";
import TourCard from "./TourCard";

function Tours() {
  return (
    <div className="section tours mb-large" id="tours">
      <Title main_title="Featured" sub_title="tours" />

      <TourCard />
    </div>
  );
}

export default Tours;
